import {
    Heading,
    Text,
    Box
  } from "@chakra-ui/react";

  export default function Comment() {

    function getComments() {
        fetch("http://localhost:8000/api/comment/")
          .then((response) => {
            return response.json();
          })
          .then((data) => {
            console.log(data);
            setData(data)
          })
          .catch((error) => {
            console.error(error);
          });
      }

    return (
      <>
        <Box maxW='32rem'>
        <Heading mb={2}>1</Heading>
        <Text fontSize='xl'>123 {getComments()}</Text>
        </Box>
      </>
    );
  }
